            if(stateCloseModal == true){
                showModal = !showModal
                return null
                
            }else{
                return null
            }
        }
        return (<div>
            {showModal ? <div className='test2'>{<BuchenPopup />}</div> : null}
            {modelCheck(closeModal)}
        </div>)
           
}

